import React, { Component } from 'react';
import './App.css';




/*
  I put (props) as the parameter because then I dont have to worry
  if I want to add or change completly its values.

  And then I destructured it into multiple variables.
*/
const MyTravelHistory = (props) => {
  const { destination, country, photo, distance } = props;
  return (
    <section>
      <img className="image" src={photo} />
      <div>
        <p>{destination}</p>
        <p>{country}</p>
        <p>{distance}</p>
      </div>
    </section>
  );
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>gggg</h1>
        <MyTravelHistory
          destination="Ushguli"
          country="Georgia"
          photo='./photos/ushguli.jpg'
          distance="3.122km"
        />

        <MyTravelHistory
          destination="Tunnel Beach, Dunedin"
          country="New Zealand"
          photo='./photos/IMG_7150.jpg'
          distance="63.66 km"
        />

        <MyTravelHistory
          destination="Tunnel Beach, Dunedin"
          country="New Zealand"
          photo='./photos/IMG_7150.jpg'
          distance="63.66 km"
        />

        <MyTravelHistory
          destination="Tunnel Beach, Dunedin"
          country="New Zealand"
          photo='./photos/IMG_7150.jpg'
          distance="63.66 km"
        />
      </div>
    );
  }
}
export default App;
